import React, { useEffect, useState } from 'react';

const App=()=>{
  const [name,setname]=useState(0);
  useEffect(()=>{
    document.title=`You Click Me`
  })
  return(
    <>
    <button onClick={()=>{setname(name+1)}}>click Me  {name} </button>
  
   </>
  )
}
export default App;
